    console.log(title, imageUrl, projectDescription, projectUrl);
    return (
        <>
            <Col>
                <Image
                    width="600px"
                    src="https://i.ibb.co/wg01kTt/Spices.jpg"
                />{' '}
            </Col>
            <Col>
                <h5>Media Heading</h5>
